export const ruleOptions = (vm: any) => {
  return {
    'info.product_name': {
      rules: [
        {
          validator: (field: any, value: any, values: any) => {
            if (!value) {
              return '请输入活动名称'
            }
          }
        }
      ],
    },
    'info.product_type': {
      rules: [
        {
          validator: (field: any, value: any, values: any) => {
            if (!value) {
              return '请输入商品类型'
            }
          }
        }
      ],
      initialValue: 1
    },
    'info.product_id': {
      rules: [
        {
          validator: (field: any, value: any, values: any) => {
            if (!value) {
              return '请选择商品'
            }
          }
        }
      ]
    },
    'info.limit_course_num': {
      rules: [
        {
          validator: (field: any, value: any, values: any) => {
            if (!value) {
              return '请输入限定课时'
            }
          }
        }
      ],
      initialValue: 1
    },
    'info.start_time': {
      rules: [
        {
          validator: (field: any, value: any, values: any) => {
            if (!value) {
              return '请选择活动开始时间'
            }
          }
        }
      ],
    },
    'info.end_time': {
      rules: [
        {
          validator: (field: any, value: any, values: any) => {
            if (!value) {
              return '请选择活动结束时间'
            }
          }
        }
      ]
    }
  }
}
